// src/pages/companyInfo/companyInfoEdit.tsx

import { useParams } from 'react-router-dom';
import { CompanyInfoProps } from '../../utils/types';
import { useEffect } from 'react';

function CompanyInfoEdit({
	user,
	companyInfoList,
	updateUser,
	updateCompanyInfoList,
}: CompanyInfoProps) {
	const { email, id } = useParams();
	// コンポーネントの中身を実装する

	useEffect(() => {
		for (let i = 0; i < companyInfoList.length; i++) {
			if (companyInfoList[i].id === id) {
				return <div>companyInfoList[i].nameのメモ</div>;
			}
		}
	});
	return <div>{companyInfoList.length}</div>;
}

export default CompanyInfoEdit;
